import Slider from 'react-slick';

function ServiceSlider(props) {
  const settings = {
    dots: false,
    infinite: false,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1
  };
  const services = props.data;

  return (
    <div className="ServiceSlider">
      <Slider {...settings}>
        {
          services.map(service => (
            <div key={service.id}>
              {service.title}
            </div>
          ))
        }
      </Slider>
    </div>
  );
}

export default ServiceSlider;
